import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { FormsModule } from '@angular/forms'; // Required for two-way binding in Settings
import { HttpClientModule } from '@angular/common/http'; // Required for API calls to Node.js backend

// Routing
import { AppRoutingModule } from './app-routing.module';

// Root Component
import { AppComponent } from './app.component';

// Layout Components
import { NavbarComponent } from './layout/navbar/navbar.component';
import { SidebarComponent } from './layout/sidebar/sidebar.component';

// Page Components
import { DashboardComponent } from './pages/dashboard/dashboard.component';
import { LiveMonitoringComponent } from './pages/live-monitoring/live-monitoring.component';
import { AnalysisReportComponent } from './pages/analysis-report/analysis-report.component';
import { GuardAssignComponent } from './pages/guard-assign/guard-assign.component';
import { SettingsComponent } from './pages/settings/settings.component';

// Shared Components
import { DashboardCardComponent } from './shared/dashboard-card/dashboard-card.component';

@NgModule({
  declarations: [
    AppComponent,
    NavbarComponent,
    SidebarComponent,
    DashboardComponent,
    LiveMonitoringComponent,
    AnalysisReportComponent,
    GuardAssignComponent,
    SettingsComponent,
    DashboardCardComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,       
    HttpClientModule   
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
